import { useState } from "react";
import YouTube from "react-youtube";

function ShowingVideos(props) {
  const [videos, setVideos] = useState(props.result);
  return (
    <>
      {videos.map((video) => (
        <ul>{<YouTube></YouTube>}</ul>
      ))}
    </>
  );
}

export default ShowingVideos;
